function CardData(props) {
    const context=props.contextData
    return (
        <Fragment>
        {context.data.map((e) => {
          return (
            <Card>
              <NewsCard
                title={e.title}
                desc={e.abstract}
                by={e.byline}
                imgUrl={e.multimedia[0].url}
              />
            </Card>
          );
        })}
      </Fragment>
    )
}

export default CardData
